DROP TABLE IF EXISTS `Teckmeb`.`DateAccept` ;

CREATE TABLE IF NOT EXISTS `Teckmeb`.`DateAccept` (
  `idProposal` INT NOT NULL,
  `idUser` INT NOT NULL,
  `accepted` TINYINT(1) NULL,
  INDEX `fk_DateAccept_DateProposal1_idx` (`idProposal` ASC),
  INDEX `fk_DateAccept_User1_idx` (`idUser` ASC),
  PRIMARY KEY (`idProposal`, `idUser`),
  CONSTRAINT `fk_DateAccept_DateProposal1`
    FOREIGN KEY (`idProposal`)
    REFERENCES `Teckmeb`.`DateProposal` (`idDateProposal`)
    ON DELETE CASCADE
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_DateAccept_User1`
    FOREIGN KEY (`idUser`)
    REFERENCES `Teckmeb`.`User` (`idUser`)
    ON DELETE CASCADE
    ON UPDATE NO ACTION)
ENGINE = InnoDB;

