	UPDATE Control
    SET median = (
		SELECT avg(t1.value) as median_val
        FROM (
			SELECT @rownum:=@rownum+1 as `row_number`, d.value
			FROM Mark d,  (SELECT @rownum:=0) r
			WHERE d.idControl = new.idControl
			ORDER BY d.value
		) as t1,
		(
			SELECT count(*) AS total_rows
			FROM Mark d
			WHERE d.idControl = new.idControl
		) as t2
		WHERE 1
		AND t1.row_number IN ( floor((total_rows+1)/2), floor((total_rows+2)/2) )
	)
	WHERE idControl = new.idControl;
END$$


USE `Teckmeb`$$
DROP TRIGGER IF EXISTS `Teckmeb`.`avg_control_delete` $$
USE `Teckmeb`$$
CREATE TRIGGER `avg_control_delete`
AFTER DELETE ON `Mark`
FOR EACH ROW
BEGIN
	UPDATE Control
    SET average = (
		SELECT avg(value)
        FROM Mark
        WHERE Mark.idControl = old.idControl
	)
	WHERE idControl = old.idControl;
	UPDATE Control
    SET median = (
		SELECT avg(t1.value) as median_val
        FROM (
			SELECT @rownum:=@rownum+1 as `row_number`, d.value
			FROM Mark d,  (SELECT @rownum:=0) r
			WHERE d.idControl = old.idControl
			ORDER BY d.value
		) as t1,
		(
			SELECT count(*) AS total_rows
			FROM Mark d
			WHERE d.idControl = old.idControl
		) as t2
		WHERE 1
		AND t1.row_number IN ( floor((total_rows+1)/2), floor((total_rows+2)/2) )
	)
	WHERE idControl = old.idControl;
END$$


